import React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton, MenuIcon} from '@material-ui/core';


export default function ButtonAppBar() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            News
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </Box>
  );
}



function Navbar(){
    return(
        <>
            <h1>Navbar</h1>
        </>
    )
}

export default Navbar;
